const CartItem=({todo})=>{
    <div className="card w-100 bg-danger" >
        <img src={todo.img} class="card-img-top" alt="..."/>
            <div className="card-body">
                <h5 className="card-title">{todo.name}</h5>
            </div>
    </div>
}

export default CartItem;
